window.bookSummaryJSON = "<p>The stunning conclusion of the Impossible Julian Strande, where all the magician’s greatest secrets are revealed…for better or worse.</p> <p>As the caretaker of the Strande Mansion, Alice got far more than she bargained for when she accepted the job. Between trying to crack the code of the sinister Julian Strande and her new love affair with Charles, the current owner of the museum, she has a lot to balance.</p> <p>Alice didn’t believe in ghosts.</p> <p>That was until she met Julian Strande.</p> <p>Unfortunately, it seems the legends of the ghost of the estate are all very real, and he seems to have become obsessed with her. Charles has promised her that Julian is harmless and just playing pranks. That he enjoys the company after all those years alone.</p> <p>It’s too bad that Charles may not be all he seems…___________</p> <p>If you’re drawn to compelling villains and sinister love stories, the Impossible Julian Strande series by USA Today Bestselling Author Kathryn Ann Kingsley is your next book obsession.</p> <p>Occult horror blends seamlessly with romance in this gripping page-turner!</p> <p>Please Note: This book contains content that may be objectionable to some listeners.</p>"; 
